import React, {useState} from 'react';
import {Button, message} from 'antd'
import DraggerComp from './Dragger';

import './App.css';

const qrcode64 = "data:image/jpeg;base64,"

const App = () => {
  const [fileList, setFileList] = useState([]);

  const handleImg = (callback) => {
    if (fileList.length === 0) {
      message.open({
        type: 'warning', content: '请先上传图片',
      });
      return;
    }

    for (const fileItem of fileList) {
      const text = '微信公众号搜【夏之荷吉他】';

      const file = fileItem.originFileObj;
      const reader = new FileReader();
      // 读取图片文件
      reader.readAsDataURL(file);
      reader.onload = (event) => {
        const img = new Image();
        img.src = event.target.result;

        img.onload = () => {
          const canvas = document.createElement("canvas");
          canvas.width = img.width;
          canvas.height = img.height;

          const ctx = canvas.getContext("2d");
          ctx.drawImage(img, 0, 0);

          ctx.save();

          ctx.fillStyle = 'rgba(0,0,0,0.3)';
          ctx.font = '30px "Microsoft YaHei"';
          ctx.textAlign = 'center';
          ctx.translate(0, canvas.height / 3 * 2);
          ctx.rotate(-Math.PI / 180 * 30);

          // 获取水印的宽度和高度
          var watermarkWidth = ctx.measureText(text).width + 20;
          var watermarkHeight = ctx.measureText(text).height + 20;

          // 循环重复绘制水印
          for (var x = 0; x < canvas.width; x += watermarkWidth) {
            for (var y = 0; y < canvas.height; y += watermarkHeight) {
              // 将水印向右移动宽度，向下移动高度
              ctx.fillText(text, x, y);
            }
          }

          const img2 = new Image();
          img2.src = qrcode64;

          img2.onload = () => {
            ctx.restore();
            ctx.drawImage(img2, canvas.width - 140, 20, 120, 120);

            ctx.fillStyle = 'rgba(0,0,0,0.3)';
            ctx.font = '24px "Microsoft YaHei"';
            ctx.fillText('禁止转载用于商业用途，违者必究！', 20, canvas.height - 20);

            canvas.toBlob((blob) => {
              const url = URL.createObjectURL(blob);
              if (callback) {
                callback(url, file.name)
              }
              URL.revokeObjectURL(url);
            }, file.type, 1);
          }
        };
      };

    }
  }

  function saveBlobToDisk(blobUrl, fileName) {
    const a = document.createElement("a");
    document.body.appendChild(a);
    a.style.display = "none";
    a.href = blobUrl;
    a.download = fileName;
    a.click();
  }

  return (<div>
      <DraggerComp fileList={fileList} setFileList={setFileList} handleImg={handleImg}/>
      <div style={{textAlign: 'center', marginTop: '20px'}}>
        <Button onClick={() => handleImg(saveBlobToDisk)}>保存图片</Button>
      </div>
    </div>)
};
export default App;
